    for entry in survey_data:
        if 'Labrador Duck' not in entry:
            return ['Disqualified data']
        parts = entry.upper().replace('-', ' ').split()
        count = int(parts.pop())
        name_parts = parts
        if len(name_parts) == 1:
            code = name_parts[0][:6]
        elif len(name_parts) == 2:
            code = name_parts[0][:3] + name_parts[1][:3]
        elif len(name_parts) == 3:
            code = name_parts[0][:2] + name_parts[1][:2] + name_parts[2][:2]
        elif len(name_parts) == 4:
            code = name_parts[0][0] + name_parts[1][0] + name_parts[2][:2] + name_parts[3][:2]
        if code in result:
            result[code] += count
        else:
            result[code] = count
    return sum([[code, result[code]] for code in sorted(result)], [])

